\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Le tube à essai + bouchon\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Le tube à essai + bouchon\"},\"subContentId\":\"7f0ebaee-da20-4e60-b65e-dfd8dbfaf0f3\"}],\"header\":\"LE TUBE À ESSAI + BOUCHON\"},{\"position\":{\"x\":71.2,\"y\":47.59148316062176},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Jamais utile pour manipuler vraiment mais si vous prenez un tube à essai, vous prendrez forcément un goupillon pour nettoyer le tube à essai (avec du liquide vaisselle !).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Le goupillon\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Le goupillon\"},\"subContentId\":\"1b180d53-2639-4fe9-95a5-24e4efd718f0\"}],\"header\":\"LE GOUPILLON\"},{\"position\":{\"x\":92.33409610983982,\"y\":53.249101739788195},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>La pince en bois ne sert pas à tenir un tube à essai (la main ou le porte-tube à essai suffisent amplement) ! Elle sert à le tenir <strong>QUAND ON LE CHAUFFE </strong><strong>SANS SE BRÛLER</strong> ! Donc, elle va forcément de pair avec la plaque chauffante.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"La pince en bois\",\"authors\":[],\"changes\":[],\"extraTitle\":\"La pince en bois\"},\"subContentId\":\"a84237bf-da21-4f82-ac22-376b068cd036\"}],\"header\":\"LA PINCE EN BOIS\"},{\"position\":{\"x\":65.90389016018307,\"y\":85.26498676248109},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Voici la seule protection que vous devez porter <strong>dès lors que vous avez du matériel en verre sur votre table</strong> et ce, même si vous n'êtes pas entrain de manipuler. Évidemment, elles protègent des projections de liquides mais elles protègent aussi des éclats de verre si vous cassez du matériel !!!</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"LES LUNETTES DE PROTECTION\",\"authors\":[],\"changes\":[],\"extraTitle\":\"LES LUNETTES DE PROTECTION\"},\"subContentId\":\"559fa011-26d7-4412-bf84-df947c47d01b\"}],\"header\":\"LES LUNETTES DE PROTECTION\"},{\"position\":{\"x\":74.59954233409611,\"y\":48.59705937972769},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Le tube à essai sert à faire des tests en petite quantité. Il doit toujours être posé sur un porte-tube à essai et NE DOIT SURTOUT PAS ÊTRE POSÉ À PLAT SUR LA TABLE CAR IL ROULERA ET SE CASSERA !!!</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"LE TUBE À ESSAI\",\"authors\":[],\"changes\":[],\"extraTitle\":\"LE TUBE À ESSAI\"},\"subContentId\":\"7fde70e1-1683-403c-93cc-f4bb4f715b1b\"}],\"header\":\"LE TUBE À ESSAI\"},{\"position\":{\"x\":45.800000000000004,\"y\":89.81946243523316},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>C'est un vêtement de protection <strong>contre les projections et les taches.</strong> Elle est en coton et absolument pas en matière synthétique (=matière plastique) car le coton brûle plus difficilement et ne fond pas sur la peau (contrairement aux matières synthétiques).</p>\\n\\n<p>Elle peut être remplacée par des vêtements en coton (dans une certaine mesure).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"LA BLOUSE DE CHIMIE\",\"authors\":[],\"changes\":[],\"extraTitle\":\"LA BLOUSE DE CHIMIE\"},\"subContentId\":\"ee409262-95e2-4103-842c-881406500c2d\"}],\"header\":\"LA BLOUSE DE CHIMIE\"},{\"position\":{\"x\":88.10068649885584,\"y\":65.84129160363086},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"visuals\":{\"fit\":false,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Video\",\"loading\":\"Chargement du lecteur
